import './App.css';
import BidirectionalScrollList from './Components/BidirectionalScrollList';
import CreateOrUpdateEmployee from './Components/CreateOrUpdateEmployee';
import FooterComponent from './Components/FooterComponent';
import HeaderComponent from './Components/HeaderComponent';
import ListEmployee from './Components/ListEmployee';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom"
import ViewEmployee from './Components/ViewEmployee';
import EmployeeScrolling from './Components/EmployeeScrolling';

function App() {
  return (
    <>
    <Router>
    <div className="container">
      <HeaderComponent/>
      <Routes>
          <Route exact path="/" element={<EmployeeScrolling/>} />
          <Route exact path="/add-employee/:id" element={<CreateOrUpdateEmployee/>} />
          <Route exact path="/view-employee/:id" element={<ViewEmployee/>} />
        </Routes>
      <FooterComponent/>
    </div>
    </Router>
    </>
  );
}

export default App;
